        <div className='.col-lg-6'>
          <textarea value={sampleText} className='form-control' rows='35'></textarea>
        </div>
        <div className='.col-lg-6'>
          <div>
            {sampleText}
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
